import axios from 'axios'

const Base_Url="http://localhost:5000/api/subin/"

var Token=JSON.parse(JSON.parse(localStorage.getItem('persist:Exp123')).usData).Pass[0] &&
JSON.parse(JSON.parse(localStorage.getItem('persist:Exp123')).usData).Pass[0].accesstoken

console.log("Localstorage Token",Token);

export const publicRequest=axios.create({baseURL:Base_Url})

export const userRequest=axios.create({
    baseURL:Base_Url})
